(function(){"use strict";onmessage=s=>{const{id:n,curves:e,step:o}=s.data,u=[e[0][0]];for(const r of e)for(let t=1;t<=o;++t)u.push(f(r,t/o));postMessage({id:n,points:u})};function c(s,n){return{x:s.x*n,y:s.y*n}}function i(...s){return{x:s.reduce((n,e)=>n+e.x,0),y:s.reduce((n,e)=>n+e.y,0)}}function f(s,n){const e=1-n,o=c(s[0],e**3),u=c(s[1],3*e**2*n),r=c(s[2],3*e*n**2),t=c(s[3],n**3);return i(o,u,r,t)}})();
